import React, { Component } from "react";
import About from "../About";
import dataFile from "./data";

export class Mains extends Component {
  constructor() {
    super();
    this.state = {
      dataFile: dataFile,
    };
  }

  render() {
    return (
      <div>
        <center>
          This is a news item
          {dataFile.array.forEach((element) => {
            return (
              <About
                title={element.title.slice(0, 15)}
                desc={
                  (element.description =
                    element.description === null
                      ? "Not available"
                      : element.description)
                }
                author={
                  (element.author =
                    element.author === null
                      ? "Not Available"
                      : element.description)
                }
                imgurl={
                  (element.urlToImage =
                    element.urlToImage === null
                      ? "Not available"
                      : element.urlToImage)
                }
                url={element.url}
              />
            );
          })}
        </center>
      </div>
    );
  }
}

export default Mains;
